window.bookSummaryJSON = "<p><i>New York Times</i> best-selling author and former Green Beret Bob Mayer brings back Chief Warrant Officer and Green Beret Dave Riley (<i>Eyes of the Hammer, Dragon Sim-13</i>) in a thriller set in the shrouded, secret world of the federal witness protection program, where he discovers once again that no one can be trusted and the stakes are life itself. </p> <p><i>Publishers Weekly</i> reference <i>Cut Out</i>: \"Well-paced with a maximum quotient of action and violence, this entry should appeal to fans of the series.\" </p> <p>When Philip Cobb, former mob money launderer and current government informer, is murdered just as he is about the enter the Program, his wife, after calling an emergency Program number only to be nearly gunned down herself, turns for help to her brother, who contacts his old girlfriend, Donna Giannini, now a Chicago cop. Giannini (who appeared in SYNBAT) in turn asks her old pal Riley to keep Lisa alive while she finds out what went wrong. The rest of the narrative pits the warrior skills and state-of-the-art special-ops technology of Riley and his men against two groups of professional killers and the heinous federal officials behind one of them.</p>"; 
